import{_ as t,c as e,o as d,a4 as a}from"./chunks/framework.C7GXSwyW.js";const u=JSON.parse('{"title":"基本概念","description":"","frontmatter":{},"headers":[],"relativePath":"readme/web/web-concept.md","filePath":"readme/web/web-concept.md","lastUpdated":1704973308000}'),o={name:"readme/web/web-concept.md"},r=a('<h1 id="基本概念" tabindex="-1">基本概念 <a class="header-anchor" href="#基本概念" aria-label="Permalink to &quot;基本概念&quot;">​</a></h1><p>前端监控中约定了部分术语，在文档和平台日常使用中频繁提到和使用。</p><table><thead><tr><th>概念</th><th>说明</th></tr></thead><tbody><tr><td>aid</td><td>应用ID，是项目的全局唯一标识。在SDK和平台中保持一致，但和常见的APP_ID不同，它不需要去专门申请，只需要保证和现有项目的AID并不重合即可。</td></tr><tr><td>pid</td><td>您的应用中标志某一个具体页面的ID，在平台中可用于过滤，分组查看数据。同样由您在SDK相关配置中指定，默认情况下，SDK会将PID设置为当前页面的URL，对于活动页或者是带有不重复ID类型的页面，建议您在SDK中配置自己的聚合策略。</td></tr><tr><td>user_id</td><td>标志当前访问用户的ID，根据user_id计算UV、影响用户数等信息，可以由您自己指定。默认情况下，系统会为您自动生成uuid并存储在localstorage中。</td></tr><tr><td>session_id</td><td>标志一次会话的ID，&quot;会话&quot;指用户进入页面开始到关闭页面为止的整个阶段。通过session_id来计算整站点PV、错误率等数据，同时用它来进行上报的去重计数。您不需要自行指定 session_id，系统会为您生成。</td></tr><tr><td>view_id</td><td>标志一次页面访问的ID，&quot;页面访问&quot;在SPA等情况下，是session的子集，一次session可能会有多个页面访问，通过它来计算单PID PV，并串联相关的静态资源、请求和Longtask上报。</td></tr><tr><td>env</td><td>用以区分上报环境的字段，通过在SDK指定不同env，可以对数据进行环境分组，避免线上环境和线下环境的数据相互污染。</td></tr></tbody></table>',3),s=[r];function _(n,i,c,p,l,h){return d(),e("div",null,s)}const b=t(o,[["render",_]]);export{u as __pageData,b as default};
